import React, {setState} from 'react'

function UseEffectCounter() {
    const [count, setCount] = setState(0);
  return (
    <div>
        <button onClick={
            () => setCount(count => count + 1)
        }>
            Increment Count ({count})
        </button>
    </div>
  )
}

export default UseEffectCounter
